import * as React from "react";
import ImageGallery from "react-image-gallery";

import { Swiper, SwiperSlide, Navigation } from "swiper/react";

import Moritzhagen1 from "../assets/Moritzhagen1.jpeg";
import Moritzhagen2 from "../assets/Moritzhagen2.jpeg";
import Moritzhagen3 from "../assets/Moritzhagen3.jpeg";
import Moritzhagen4 from "../assets/Moritzhagen4.jpeg";
import Moritzhagen5 from "../assets/Moritzhagen5.jpeg";
import Moritzhagen6 from "../assets/Moritzhagen6.jpeg";
import Moritzhagen7 from "../assets/Moritzhagen7.jpeg";
import Moritzhagen8 from "../assets/Moritzhagen8.jpeg";
import Moritzhagen9 from "../assets/Moritzhagen9.jpeg";
import Moritzhagen10 from "../assets/Moritzhagen10.jpeg";
import Moritzhagen11 from "../assets/Moritzhagen11.jpeg";
import Moritzhagen12 from "../assets/Moritzhagen12.jpeg";
import "swiper/css";
export default function MasonryImageList() {
	return (
		<div className="galleryBox">
			<h3>Gallerie</h3>
			<Swiper className="mySwiper">
				<SwiperSlide>
					<img src={Moritzhagen1}></img>
				</SwiperSlide>
				<SwiperSlide>
					<img src={Moritzhagen2}></img>
				</SwiperSlide>
				<SwiperSlide>
					<img src={Moritzhagen3}></img>
				</SwiperSlide>
				<SwiperSlide>
					<img src={Moritzhagen4}></img>
				</SwiperSlide>
				<SwiperSlide>
					<img src={Moritzhagen5}></img>
				</SwiperSlide>
				<SwiperSlide>
					<img src={Moritzhagen6}></img>
				</SwiperSlide>
				<SwiperSlide>
					<img src={Moritzhagen7}></img>
				</SwiperSlide>
				<SwiperSlide>
					<img src={Moritzhagen8}></img>
				</SwiperSlide>
				<SwiperSlide>
					<img src={Moritzhagen9}></img>
				</SwiperSlide>
			</Swiper>
		</div>
	);
}

const itemData = [
	{
		original: Moritzhagen1,
		title: "Bed",
	},
	{
		original: Moritzhagen2,
		title: "Books",
	},
	{
		original: Moritzhagen3,
		title: "Sink",
	},
	{
		original: Moritzhagen4,
		title: "Kitchen",
	},
	{
		original: Moritzhagen5,
		title: "Blinds",
	},
	{
		original: Moritzhagen6,
		title: "Chairs",
	},
	{
		original: Moritzhagen7,
		title: "Laptop",
	},
	{
		original: Moritzhagen8,
		title: "Doors",
	},
	{
		original: Moritzhagen9,
		title: "Coffee",
	},
	{
		original: Moritzhagen10,
		title: "Storage",
	},
	{
		original: Moritzhagen11,
		title: "Candle",
	},
	{
		original: Moritzhagen12,
		title: "Coffee table",
	},
];
